import React from 'react';
import { ContainerHeader } from './AppStyles';
import SearchBar from './components/SearchBar';

function App() {
  return (
    <div style={{ paddingLeft: 100, paddingRight: 100 }}>
      <ContainerHeader>
        <p>Fundos</p>
        <SearchBar
          value="Buscar"
          handleChange={ () => false }
        />
      </ContainerHeader>
    </div>
  );
}

export default App;
